import React, { useState } from "react"

function Profile(props) {

const[email, setEmail] = useState('z@k.com');
return(
    <div>
        <input 
        onChange={(e) => setEmail(e.target.val)}
        />
        <p> {email} </p>
    </div>
    );
}
export default Profile
